import 'package:test/test.dart';

void main() {
  test(
    '[BUG FIX] There is a bug where a unknown generated off item is generated from no where',
    () async {
      final input =
          mockInputHumanFriendlyArbKey
              .map(HumanFriendlyArbKeyResponse.fromJson)
              .toList();
      final result = await mapStringsHierarchy(strings: input);
      expect(result.isSuccess(), isTrue);

      final resultAsSucess = result.getOrThrow();

      final doesNotContainItemWithChild = resultAsSucess.any(
        (e) => e == unknownGeneratedOffItem,
      );
      expect(doesNotContainItemWithChild, isFalse);
    },
  );
}

