  {
    "key": "playerLevelExplanation",
    "value": {
      "value":
          "'各選手は、年齢、出場時間とスタッツ、代表チームへの選出、現在プレーしているリーグに基づいてレベル分けをしています。\\n  Level A: A代表に選出されている、またはレベルの高いリーグでプレーしていて市場価値が高い選手。\\n  Level B: 所属リーグ内で高く評価されている選手。\\n  Level C: 国内トップリーグに所属する選手、または下位リーグで活躍する若手選手。\\nLevel D: 下位リーグに所属している選手、または上位リーグに所属するがプレー時間が少ない選手。\\n  Level E: 認知度の低いクラブに所属している選手、または1年以上プレーしていない選手。\\n  不明: まだ市場に情報が出ていない選手。'",
      "filePath":
          "/Users/igormidev/gobabel/scoutbox-app/lib/gen_l10n/s_ja.dart",
      "parentStartIndex": null,
      "parentEndIndex": null,
      "fileStartIndex": 17777,
      "fileEndIndex": 18096,
      "dynamicFields": [],
    },
  },
  {
    "key": "potentialExplanation",
    "value": {
      "value":
          "'ポテンシャル: 現在のシーズンでのポジションごとの主要なパフォーマンス指標に従って、レベルに付随して、選手の今後2年の傾向を測定するパラメータです。選手のレベルの横についている +, °, - のマークがポテンシャルを表します(例: A+, A°, A-)\\n  +（成長): レベルに + がつく選手は成長していることを示しています。同じレベルおよびポジションの中でトップパフォーマーの1人です。ポジションごとの主要なスタッツを考慮すると、この選手が同じレベルの選手の上位40%に属しており、これはこの選手が今後2年でレベルをさらに上げやすい傾向を強く示しています。\\n  °(安定): レベルに ° がつく選手は安定的な状態にいることを示しています。同じレベルおよびポジションの選手の中で平均的な成績を収めた選手の1人です。ポジションごとの主要なスタッツを考慮すると、この選手は同じレベルの平均的な選手に似ており、これはこの選手が今後2年で同じレベルを維持しやすい傾向を示しています。\\n  -(減退): レベルに - がつく選手は減退傾向にあることを示しています。同じレベルおよびポジションの選手の中で、最もパフォーマンスの低い選手の1人です。ポジションごとの主要なスタッツを考慮すると、この選手は同じレベルの選手の下位20%に属しており、これはこの選手が今後2年でレベルが下がりやすい傾向を示しています。'",
      "filePath":
          "/Users/igormidev/gobabel/scoutbox-app/lib/gen_l10n/s_ja.dart",
      "parentStartIndex": null,
      "parentEndIndex": null,
