  {
    "key": "playerTechnicalLevelDescription",
    "value": {
      "value":
          "'''\n選手について、以下の項目を中心に定義した技術レベルです。\n\n- 所属リーグ\n- 年齢\n- 今シーズンのパフォーマンス\n- ナショナルリーグへの所属\n\n|レベル|概要|\n|:--:|----|\n| A | 市場でのブランドが確立された、サッカー界トップレベルのアスリート|\n| B | 大陸で高い評価を得ているサッカー界でハイレベルのアスリート|\n| C | 国内トップリーグに所属する出場時間の少ない選手、下位のリーグで優れたパフォーマンスを発揮している選手、または優れたカリキュラム/または年齢競技シナリオとの関連性がほとんどないアスリート|\n| D | 下位リーグまたはユースカテゴリに所属する選手 |\n| E | マイナーなリーグや知名度の低いクラブのプロまたはユース選手 |\n| ? | Poolレベルが不明な選手 |\n'''",
      "filePath":
          "/Users/igormidev/gobabel/scoutbox-app/lib/data/guide_item.dart",
      "parentStartIndex": null,
      "parentEndIndex": null,
      "fileStartIndex": 1692,
      "fileEndIndex": 2063,
      "dynamicFields": [],
    },
  },
  {
    "key": "playerTechnicalLevelDefinition",
    "value": {
      "value":
          "'''\nDefinition of the player's current technical level using criteria such as:\n\n- National league\n- Age\n- Current season performance\n- Main or Youth National Team\n\n|Pool|description|\n|:--:|----|\n| A | Top tier athletes in football industry with established brands in the market. |\n| B | High quality tier athletes in football industry who have a continental reputation. Consolidated carreers. |\n| C | Professional athletes in top tier clubs of their countries with low minutes or athletes from smaller divisions with significant performances in the market or with a good curriculum and/or advanced age and little relevance in the competitive scenario. |\n| D | Athletes of lower divisions, or youth categories. |\n| E | Professional or youth athletes from minor divisions and small reputation clubs. |\n| ? | Athletes who do not know the pool level |\n'''",
      "filePath":
          "/Users/igormidev/gobabel/scoutbox-app/lib/data/guide_item.dart",
      "parentStartIndex": null,
      "parentEndIndex": null,
      "fileStartIndex": 2091,
