    "key": "playerRankingExplanation",
    "value": {
      "value":
          "'Each player receives a ranking based on their age, playing time and status, national team affiliation and the league they are currently playing at.\\n\\nLevel A: Best level there is. Competitive league and an established brand in the market.\\n\\nLevel B: Players highly rated in the continent of their league.\\n\\nLevel C: Players who belong to the domestic top league and young players who are demonstrating excellent performance in lower leagues.\\n\\nLevel D: Players belonging to lower leagues or not having much play time in top leagues.\\n\\nLevel E: Players in lesser-known clubs or more than 1 year without play time.\\n\\nUndefined: Players who have not been evaluated yet.\\n\\nLevel F: An \"Amateur A\" player. They are players who are not professionals but have a high level of play.\\n\\nLevel G: An \"Amateur B\" player. They are players who are not professionals but have a medium level of play.\\n\\nLevel H: An \"Amateur C\" player. They are players who are not professionals but have a low level of play.'",
