    "value": {
      "value":
          "'Standard: Goalkeeper who defends with consistency directing the ball to the end line. He can be a good penalty saver. Good interceptions in the aerial ball. He does not work the ball with his feet often.\\n\\nDistribution: Goalkeeper with great ability to build, with short, medium and long passes. Offers passing line conditions to defenders. Makes long passes to quickly connect the attack.\\n\\nSweeper: Goalkeeper who shows good depth control, leaving the box with good quality when needed.'",
