  {
    "key": "defenderPlayingStyles",
    "value": {
      "value":
          "'Ball Playing: Defender who has technique and quality of passing, showing great ball control and ability to move forward. Can help with short and medium passes that break lines, connecting midfielders, side backs or even wingers.\\n\\nMobility & Anticipation: Fast defender, who has good anticipation speed, agility to stop dribbling actions and speed to overcome attackers in speedy contests. Composition in deep balls.\\n\\nPower: Defender with excellent physical strength, who is dominant in defensive 1-on-1 duels and can consistently win tackles. Usually performs lots of long passes. A physical player.'",
      "filePath":
