  {
    "key": "fullBackPlayingStyles",
    "value": {
      "value":
          "'Inside: Ability to build in the central and lateral corridor (1st and 2nd phase of construction), with precision in front and diagonal passes. Accurate crosses both from the third and final quarter.\\n\\nDefensive: Shows assertive body movement on covered and uncovered ball, control of the depth of the last line, defensive 1-on-1 (approaching on the duel to tackle), defensive aerial ball and usually can play as center back as well.\\n\\nOffensive: Ability to go beyond the line of the ball, inside to finish or outside to cross. Constantly wins offensive 1-on-1 duels (dribbling). Masters the underlapping and overlapping, showing good speed and vision to attack the space. Sometimes can also play as a winger.'",
